pragma solidity >=0.4.22 <0.7.0;

/// @title Standard Organigr.am Contracts Organ contract.

import "./Kelsen.sol";
import "./libraries/organLibrary.sol";

contract Organ is Kelsen(true,false) {

    // Linking to Organ library.
    using OrganLibrary for OrganLibrary.OrganData;
    OrganLibrary.OrganData public organData;

    address public factory;

    /*
        Organ management.
    */

    // Constructor.
    constructor(address owner, bytes32 metadataIpfsHash, uint8 metadataHashFunction, uint8 metadataHashSize)
        public
    {
        factory = msg.sender;
        organData.init(owner, metadataIpfsHash, metadataHashFunction, metadataHashSize);
    }

    // Receiving funds.
    function deposit() external payable {
        organData.deposit();
    }

    function receive() external payable {
        organData.deposit();
    }

    function updateMetadata(bytes32 ipfsHash, uint8 hashFunction, uint8 hashSize)
        public
    {
        organData.updateMetadata(ipfsHash, hashFunction, hashSize);
    }

    function withdraw(address payable to, uint value)
        public
    {
        organData.withdraw(to, value);
    }

    /*
        Procedures management.
    */

    function addProcedure(address procedure, uint8 permissions)
        public
    {
        organData.addProcedure(procedure, permissions);
    }

    function removeProcedure(address procedure)
        public
    {
        organData.removeProcedure(procedure);
    }

    function replaceProcedure(address oldProcedure, address newProcedure, uint8 permissions)
        public
    {
        organData.replaceProcedure(oldProcedure, newProcedure, permissions);
    }

    /*
        Entries management.
    */

    function addEntry(address payable addr, bytes32 ipfsHash, uint8 hashFunction, uint8 hashSize)
        public returns (uint index)
    {
        return organData.addEntry(addr, ipfsHash, hashFunction, hashSize);
    }

    function removeEntry(uint index)
        public
    {
       organData.removeEntry(index);
    }

    function replaceEntry(uint index, address payable addr, bytes32 ipfsHash, uint8 hashFunction, uint8 hashSize)
        public
    {
       organData.replaceEntry(index, addr, ipfsHash, hashFunction, hashSize);
    }

    /*
        Utilities for contracts.
    */

    function getPermissions(address addr)
        public view
        returns (
            uint8 permissions,
            bool canAddProcedure, bool canRemoveProcedure,
            bool canAddEntry, bool canRemoveEntry,
            bool canWithdraw, bool canDeposit
        )
    {
        permissions = organData.permissions[addr];
        return (
            permissions,
            permissions & 0x80 == 0x80,
            permissions & 0x40 == 0x40,
            permissions & 0x08 == 0x08,
            permissions & 0x04 == 0x04,
            permissions & 0x02 == 0x02,
            permissions & 0x01 == 0x01
        );
    }

    function getEntriesLength()
        public view returns (uint length)
    {
        return organData.entries.length;
    }

    function getEntryIndexForAddress(address addr)
        public view returns (uint index)
    {
        return organData.addressIndexInEntries[addr];
    }

    function getEntry(uint index)
        public view
        returns (address payable addr, bytes32 ipfsHash, uint8 hashFunction, uint8 hashSize)
    {
        return (
            organData.entries[index].addr,
            organData.entries[index].ipfsHash,
            organData.entries[index].hashFunction,
            organData.entries[index].hashSize
        );
    }

    function getProceduresLength()
        public view returns (uint length)
    {
        return organData.procedures.length;
    }

    function getProcedureIndexForAddress(address addr)
        public view returns (uint index)
    {
        return organData.addressIndexInProcedures[addr];
    }

    function getProcedure(uint index)
        public view
        returns (address addr)
    {
        return organData.procedures[index];
    }
}
